import React from "react";
import PropTypes from "prop-types";
import Head from 'next/head';
import 'antd/dist/antd.css'

const Twity = ({ Component }) => {
    return (
        <>
            <Head>
                <meta charset="utf-8"/>
            </Head>

            <div> 공통메뉴 </div>
            <Component />
        </>
    );
};

Twity.propTypes = {
    Component: PropTypes.elementType.isRequired
};

export default Twity;
